;; **
;;; Let's load the target image, and convert it to gray with a bit of blur, so that canny can work on it. 
;; **

;; @@
(def tennis 
  (-> "resources/chapter03/tennis_ground.jpg" 	imread ))
(def can  (-> 
            tennis 
            clone 
            (cvt-color! COLOR_BGR2GRAY) 
            (canny! 50.0 180.0 3 false)))
(u/mat-view tennis)
(u/mat-view can)
