;; <=

;; @@

(def lines (new-mat))
(hough-lines can lines 1 (/ Math/PI 90) 100)

(def result (clone parking))
(dotimes [ i (.rows lines)]
   (let [ val_ (.get lines i 0) 
          rho (nth val_ 0) 
          theta (nth val_ 1) 
          a (Math/cos theta)
          b (Math/sin theta)
          x0 (* a rho)
          y0 (* b rho)
          pt1 (new-point 
              (Math/round (+ x0 (* 1000 (* -1 b)))) 
              (Math/round (+ y0 (* 1000 a))))
          pt2 (new-point 
              (Math/round (- x0 (* 1000 (* -1 b)))) 
              (Math/round (- y0 (* 1000 a))))       
     ]
  (line result pt1 pt2 color/black 1)))

(u/mat-view result)
