;; **
;;; ## Finding only pockets on a pool table
;; **

;; @@
(def pool 
  (-> 
    "resources/chapter03/pooltable.jpg" 
    (imread IMREAD_REDUCED_COLOR_2)))
(u/mat-view pool)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"640\" height=\"360\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6fcaf5c7 \"BufferedImage@6fcaf5c7: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1a40145 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 640 height = 360 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def gray (-> pool clone (cvt-color! COLOR_BGR2GRAY)))
(def minRadius 10)
(def maxRadius 18)
(def circles (new-mat))
(hough-circles gray circles CV_HOUGH_GRADIENT 1 minRadius 120 10 minRadius maxRadius)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def output (clone pool))
(dotimes [i (.cols circles)]
  (let [ _circle (.get circles 0 i) 
         x (nth _circle 0) 
         y (nth _circle 1) 
         r (nth _circle 2)  
         p (new-point x y)]
  (circle output p (int r) color/white 3)))
  
(u/mat-view output)
